var pdf = new jsPDF({
    unit: 'in'
});

pdf.addFont("Calibri.ttf", "Calibri", "normal");
pdf.addFont("Calibri-bold.ttf", "Calibri", "bold")
pdf.setFont("Calibri");

var currTextXPos = .45;
var currTextYPos = 1.7;
var lineHeight = .2;
var paraBreak = .7;
var first = true;

var imgData = 'data:image/jpeg;base64,';
