var app = new Vue({
    el: "#app",
    data:{
        date: "",
        blomqT:"",
        dorisT: "",
        culbT: "",
        historicT: "",
    },

    methods: {
        submitNewEntry: function(){
            if(this.date == ""){
                return;
            }

            var currDate = this.date;
            this.setPDFHeader();
            var blomqT = this.sanitizeData(this.blomqT, 'BLOMQUIST GARDEN OF NATIVE PLANTS');
            var dorisT = this.sanitizeData(this.dorisT, 'DORIS DUKE CENTER GARDENS');
            var culbT = this.sanitizeData(this.culbT, 'CULBERSON ASIATIC ARBORETUM');
            var historicT = this.sanitizeData(this.historicT, 'HISTORIC GARDENS');

            var finalObj = {};
            finalObj["date"] = currDate;
            finalObj["blomqT"] = blomqT;
            finalObj["dorisT"] = dorisT;
            finalObj["culbT"] = culbT;
            finalObj["historicT"] = historicT;
            
           database.ref().child("posts").push(finalObj);
           this.buildPDF();
        },
        
        sanitizeData: function(textEntry, title){
            pdf.setPage(2);
            if (first){
                first = false;
                this.setPDFTitle(title);
            }
            
            else {
                currTextYPos = currTextYPos + paraBreak;
                this.setPDFTitle(title);
            }
            
            var initSplit = textEntry.split(",")
            var finalText = [];
            this.setPDFParaSettings();
            initSplit.forEach(function(sText){
                currTextYPos = currTextYPos + lineHeight;
                pdf.text(currTextXPos, currTextYPos, $.trim(sText))
                finalText.push({
                    "plant": $.trim(sText)                    })
            });
            return finalText;
        },
        
        addPlantToPDF: function(){
            
        },
        
        setPDFTitle(titleText){
            pdf.setFontType('bold');
            pdf.setFontSize(14);
            pdf.text(currTextXPos, currTextYPos, titleText);
        },

        setPDFParaSettings(){
            pdf.setFontType('normal');
            pdf.setFontSize(12);
        },

        buildPDF: function(){
            var pdfTitle = "whats_in_bloom" + this.date;
            this.setPDFParaSettings();
            pdf.save(pdfTitle);
        },

        setPDFHeader: function() {
            var currDate = this.date;
            pdf.setPage(1);
            pdf.setTextColor(112, 119, 46);
            this.setPDFHeaderText(5,2,112, 119, 46);
            this.setPDFHeaderDate(5, 1.85);
            this.setPDFDatePg2();
            pdf.setTextColor(0,0,0);
        },

        setPDFHeaderText: function(x, y, r, g, b) {
            pdf.setPage(1);
            pdf.setTextColor(r,g,b);
            pdf.setFontType("bold");
            pdf.setFontSize(24);
            pdf.text("WHAT'S IN BLOOM", 4.256, 1.628)
        },

        setPDFDatePg2: function(){
            pdf.setPage(2);
            pdf.setTextColor(112, 119, 46);
            pdf.setFontSize(16);
            pdf.setFontType("normal");
            pdf.text(this.dateInWords, 4.82, 1.247);
        },

        setPDFHeaderDate: function(x, y) {
            pdf.setFontSize(16);
            pdf.setFontType("normal");
            pdf.text(this.dateInWords, x, y);
        }
        
    },
    computed: {
       dateInWords: function () {
        //y,m,d
        var splitDate = this.date.split("-");
        var monthNum = parseInt(splitDate[1])-1;
        var months = ["January", "February", "March", "April", "May", "June", "July", "August", "September", "October", "November", "December"];
        var month = months[monthNum];
        var finalString = month + " " + splitDate[2] + ", " + splitDate[0];
        return finalString;
        }
    }
    
})